import React from 'react'

//1. 이미지 들어가기
//2. 상품설명 들어가기

const ProductCard = ({item}) => {
  
  console.log("item:", item);
    return (
    <div>
      <img src={item?.img} alt=""/>
      <div> Conscious choice</div>
      <div>{item?.title}</div>
      <div>{item?.price}</div>
      <div>신제품</div>
    </div>
  )
}

export default ProductCard
